    NeworderPage.prototype.calculation = function () {
        try {
            if (this.cartproduct != undefined || this.cartproduct != null) {
                if (this.cartproduct.length == 0)
                    this.Iscartproduct = false;
                else
                    this.Iscartproduct = true;
                this.tobeRedeem = this.formprod.controls["tobeRedeem"].value;
                var TotalAmount = this.cartproduct.reduce(function (sum, item) { return sum + (item.TotalAmount == "" ? 0 : Number(item.TotalAmount)); }, 0);
                this.sumtotalamount = TotalAmount; //-Number(this.formprod.controls["tobeRedeem"].value);
                var discount = this.cartproduct.reduce(function (sum, item) { return sum + (item.discount == "" ? 0 : Number(item.discount)); }, 0);
                this.sumdiscount = discount;
                var GstAmount = this.cartproduct.reduce(function (sum, item) { return sum + (item.GstAmount == "" ? 0 : Number(item.GstAmount)); }, 0);
                this.sumGstAmount = GstAmount;
                var amount = this.cartproduct.reduce(function (sum, item) { return sum + (item.Amount == "" ? 0 : Number(item.Amount)); }, 0);
                // sumtotalamount
                if (this.cartproduct.some(function (item) { return item.value === 'MRP'; })) {
                    var amt = this.cartproduct.reduce(function (sum, item) { return sum + (item.Amount == "" ? 0 : Number(item.Amount)); }, 0);
                    var dscamt = this.cartproduct.reduce(function (sum, item) { return sum + (item.discount == "" ? 0 : Number(item.discount)); }, 0);
                    this.sumamount = amt + dscamt;
                }
                else {
                    this.sumamount = amount;
                }
            }
            else {
                this.Iscartproduct = false;
                this.sumtotalamount = 0;
                this.sumdiscount = 0;
                this.sumGstAmount = 0;
                this.sumamount = 0;
            }
        }
        catch (error) {
            this.commonfun.presentAlert("Message", "Error", error);
        }
    };
